    title: ''
  })
  return (
    <div>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} options={options}>
        
      </Drag>
      <Drag sizeOptions={['relax', 'giant']} options={options}>
        
      </Drag>
    </div>
  );
}
